import React, { useState } from 'react';
import './App.css';
import { Button, Tabs } from 'antd';
import TimeProgress from './TimeProgress';

import type { TabsProps } from 'antd';

const App: React.FC = () => {
  const [sessions, setSessions] = useState([
    { title: 'Warm-UP', time: 15, color: '#264653dd' },
    { title: 'Common Sentences', time: 20, color: '#2a9d8fdd' },
    { title: 'Listening', time: 30, color: '#e9c46add' },
    { title: 'Speaking', time: 20, color: '#f4a261dd' },
    { title: 'Discussion', time: 20, color: '#e76f51dd' },
    { title: 'Fixing Issues', time: 15, color: '#fcbf49dd' },
  ]);

  const sessionsList = (
    <div className="sessions-container">
      {sessions.map((s, i) => (
        <div key={i}>
          {s.title}: {s.time}mins
        </div>
      ))}
    </div>
  );

  return (
    <div className="app">
      <h1>Class Timer</h1>
      {/* <hr />
      {sessionsList}
      <hr /> */}

      <Tabs
        defaultActiveKey="1"
        items={[
          {
            label: 'Course Part 1',
            key: '1',
            children: <TimeProgress sessions={sessions} />,
          },
          {
            label: 'Course Part 2',
            key: '2',
            children: <TimeProgress sessions={sessions} />,
          },
        ]}
        onChange={console.log}
      />
      {/* <Button type="primary">Button</Button> */}
    </div>
  );
};

export default App;
